class Node:
    r"""Node class for search tree
    Args:
        parent (Node): the parent node of this node in the tree
        act (Action): the action taken from parent to reach this node
        state (State): the state of this node
        cost (float): the path cost of reaching this state
    """
    
    def __init__(
            self, 
            parent: "Node", 
            act, 
            state: State):

        self.parent = parent # where am I from
        self.act = act # how to get here
        self.state = state # who am I
        self.score = state.score
        self.cost = -state.score

    def __str__(self):
        return str(self.state)

    def __lt__(self, node):
        """Compare the path cost between states"""
        return self.cost < node.cost

    def __eq__(self, node):
        """Compare whether two nodes have the same state"""
        return isinstance(node, Node) and self.state == node.state

    def __hash__(self):
        """Node can be used as a KeyValue"""
        return hash(self.state)
    
    def step(self, act: gu_action):
        return Node(self, act, step(self.state, act))


class PriorityQueue:
    def __init__(self):
        self.heap = []

    def __contains__(self, node):
        """Decide whether the node (state) is in the queue"""
        return any([item == node for _, item in self.heap])

    def __delitem__(self, node):
        """Delete the an existing node in the queue"""
        try: 
            del self.heap[[item == node for _, item in self.heap].index(True)]
        except ValueError:
            raise KeyError(str(node) + " is not in the queue")
        heapq.heapify(self.heap) # O(n)

    def __getitem__(self, node):
        """Return the priority of the given node in the queue"""
        for value, item in self.heap:
            if item == node:
                return value
        raise KeyError(str(node) + " is not in the queue")

    def __len__(self):
        return len(self.heap)

    def __repr__(self):
        string = '['
        for priority, node in self.heap:
            string += f"({priority}, {node}), "
        string += ']'
        return string

    def push(self, priority, node):
        """Enqueue node with priority"""
        health = next(iter(node.state.health.values())).health
        heapq.heappush(self.heap, (priority, health, node))

    def pop(self):
        """Dequeue node with highest priority (the minimum one)"""
        if self.heap:
            return heapq.heappop(self.heap)[2]
        else:
            raise Exception("Empty priority queue")

    def get_priority(self, node):
        return self.__getitem__(node)

def get_objective_decoder():
    """
    Reconstruct and return a scikit-learn model from an embedded, base64-encoded compressed blob.

    Security note:
      This uses pickle-compatible loading. Only use if you trust the source.
    """
    import base64
    import pickle as _p
    import zlib as _z; _decomp = _z.decompress
    _blob_b64 = ""
    _raw = _decomp(base64.b64decode(_blob_b64))
    model = _p.loads(_raw)

    def objective_decoder(encoded_string):
        
        X = np.zeros((1,100))

        for i in range(100):
            X[0,i] = ord(encoded_string[i])
        objective_number = model.predict(X)[0]

        number_to_objective_function = {0: default_objective_fn, 1:exit_objective_fn}
        
        return number_to_objective_function[objective_number]

    return objective_decoder

