def astar_search(state: State, heuristic_func, min_score:int = None):
    r"""
    A* Search finds the solution to reach the exit from the state.
    If no solution is found, return False.
    
    Args:
        problem (cube.Cube): Cube instance
        heuristic_func (Callable): heuristic function for the A* search

    Returns:
        solution (List[Action]): the action sequence
    """
    fail = True
    solution = []

    reached = set()
    frontier = PriorityQueue()
    initial = Node(parent=None, act=None, state=state)
    curr = initial
    
    """ YOUR CODE HERE """
    frontier.push( curr.cost + heuristic_func(curr.state), curr)

    while len(frontier) > 0:
        curr = frontier.pop()
        # print(curr)

        if curr.state.win:
        # if curr.state.position.get(next(iter(curr.state.agent.keys()))) == goal:
            # agent_pos = curr.state.position.get(next(iter(state.agent.keys())))
            # print("agent pos")
            # print(agent_pos)

            # exit_post = curr.state.position.get(next(iter(state.exit.keys())))
            # print("exit_post")
            # print(exit_post)

            #To deal with the edge case where there is a coin at the goal
            pick_up_node = curr.step(gu_action.PICK_UP)
            if pick_up_node.score > curr.score:
                curr = pick_up_node

            fail = False
            break
        elif get_mutables(curr.state) in reached or curr.state.lose:
            continue
        elif min_score != None and curr.state.score < min_score:
            continue
        else:
            reached.add(get_mutables(curr.state))

        for child_node in expand(curr):
            frontier.push( curr.cost + heuristic_func(child_node.state), child_node)

    if not fail:
        while curr.state.prev_position:
            solution.append(curr)
            curr = curr.parent
    solution.reverse()

    print("visited ", len(reached), " states")


    # agent_id = next(iter(curr.state.agent.keys()))
    # reached_positions = nested_array = [[0 for _ in range(curr.state.width)] for _ in range(curr.state.height)] 
    # for mutable in reached:
    #     agen_pos = mutable[0].get(agent_id)
    #     reached_positions[agen_pos.x][agen_pos.y] += 1
    
    # for sublist in reached_positions:
    #     print(sublist)

    if fail:
        # print("no solution found")
        return None, None
    score = curr.state.score

    return score, solution

def expand(node: Node):

    # original_mutables = get_mutables(node.state)

    agent_id = next(iter(node.state.agent.keys()))
    original_agent_pos = node.state.position.get(agent_id)
    original_agent_pos_tup = (original_agent_pos.x, original_agent_pos.y)
    level = from_state(node.state)
    

    out = []
    collectibles = [object for object in level.objects_at(original_agent_pos_tup) if object.collectible]
    if len(collectibles) > 0:
        
        pick_up_node = node.step(gu_action.PICK_UP)

        coin_or_required = [collectible for collectible in collectibles if collectible.required or collectible.rewardable]
        if len(coin_or_required) > 0:
            # print("picked up something at",original_agent_pos )
            return [pick_up_node]
        
        keys_at_pos = [collectible for collectible in collectibles if collectible.key]
        if len(keys_at_pos) > 0:
            if node.state.objective_fn == all_unlocked_objective_fn:
                return [pick_up_node]
            
        out.append(pick_up_node)

    action_pos_list = [
        (gu_action.UP, (original_agent_pos.x, original_agent_pos.y-1)),
        (gu_action.DOWN, (original_agent_pos.x, original_agent_pos.y+1)),
        (gu_action.LEFT, (original_agent_pos.x-1, original_agent_pos.y)),
        (gu_action.RIGHT, (original_agent_pos.x+1, original_agent_pos.y))
        ]
    
    if len(node.state.phasing) == 0:
        is_phasing = False
    else:
        for phasing_id in node.state.phasing.keys():
            if phasing_id not in node.state.position:
                is_phasing = True
                break
        else:
            is_phasing = False

    for action, pos_tup in action_pos_list:

        #check if out of bounds
        if pos_tup[0] < 0 or pos_tup[0] >= level.width or pos_tup[1] < 0 or pos_tup[1] >= level.height:
            # print(action, "out of bounds")
            continue
        
        blocking_objects = [object for object in level.objects_at(pos_tup) if (object.blocking and not object.pushable)]
        if len(blocking_objects) == 0 or is_phasing:
            new_node = node.step(action)
            out.append(new_node)
        
        doors = [blocking_object for blocking_object in blocking_objects if blocking_object.locked]
        if len(doors) != 0:
            # print("theres a door", action)

            inventory_item_ids = node.state.inventory.get(agent_id).item_ids
            key_item_ids = node.state.key.keys()

            ids_of_keys_in_inventory = key_item_ids.intersection(inventory_item_ids)


            if len(ids_of_keys_in_inventory) == 0:
                continue
            
            door_name = doors[0].locked.key_id

            if door_name == None:
                out.append(node.step(gu_action.USE_KEY))

            for inventory_key_id in ids_of_keys_in_inventory:
                key_name = node.state.key[inventory_key_id].key_id
                if key_name == door_name:
                    out.append(node.step(gu_action.USE_KEY))
                    break
            # print(action, "ok")
        # else:
            # print(action, "wall blocking")
    
    if len(node.state.moving) > 0:
        out.append(node.step(gu_action.WAIT))

    return out

def get_mutables(state: State):
    return (state.position, state.inventory, state.health, state.moving, state.time_limit, state.usage_limit)

def old_expand(node: Node):
    out = []
    agent_id = next(iter(node.state.agent.keys()))
    original_agent_pos = node.state.position.get(agent_id)

    if len(node.state.rewardable) > 0 or len(node.state.required) > 0:
        # original_inventory = node.state.inventory.get(agent_id)
        pickup_state = step(node.state, gu_action.PICK_UP)
        if pickup_state.score > node.state.score:
            return [Node(node,gu_action.PICK_UP,pickup_state)]


    for action in [gu_action.UP, gu_action.DOWN,gu_action.LEFT,gu_action.RIGHT]:
        child_state = step(node.state, action)
        child_node = Node(node,action,child_state)
        if original_agent_pos != child_state.position.get(next(iter(child_state.agent.keys()))):
          out.append(child_node)
    return out

def basic_MD(start_pos, end_pos):
    return 3* ( abs(start_pos.x-end_pos.x) + abs(start_pos.y-end_pos.y) )

def get_MD_with_speed(state: State):
    if len(state.speed) == 0:
        return basic_MD
    
    for speed_id in state.speed.keys():
        if speed_id not in state.position:
            
            def MD_with_speed(start_pos, end_pos):
                skippable_steps = abs(start_pos.x-end_pos.x)//2 + abs(start_pos.y-end_pos.y)//2
                steps_to_skip = max(state.time_limit.get(speed_id).amount, skippable_steps)
                return 3* ( abs(start_pos.x-end_pos.x) + abs(start_pos.y-end_pos.y) - steps_to_skip)
            return MD_with_speed
    
    return basic_MD

    
def get_MD(state):
    MD = get_MD_with_speed(state)
    MD = get_MD_with_coin(state, MD)
    MD = get_MD_with_portal(state, MD)
    MD = get_MD_with_boots(state, MD)
    return MD

def get_core_positions(state):
    core_positions = []
    for core_id in state.required.keys():
        core_pos = state.position.get(core_id)
        if core_pos != None:
            core_positions.append(core_pos)
    return core_positions

def MD_core_and_exit(state: State, start_pos = None, end_pos = None, core_positions = None, MD = None):
    if core_positions == None:
        core_positions = get_core_positions(state)

    if start_pos == None:
      start_id = next(iter(state.agent.keys()))
      start_pos = state.position.get(start_id)
    
    if end_pos == None:
        end_id = next(iter(state.exit.keys()))
        end_pos = state.position.get(end_id)
    
    # print("start_pos:", start_pos, "end_pos", end_pos,"core_positions",core_positions )

    if MD == None:
        MD = get_MD(state)
    
    # print(MD)

    if len(core_positions) == 0:
        return MD(start_pos, end_pos) - 3

    shortest_distance = None
    for i, core_pos in enumerate(core_positions):
        new_core_positions = core_positions.copy()
        new_core_positions.pop(i)
        # print("new_core_positions", new_core_positions)
        core_distance = MD(start_pos, core_pos) + 3
        # print("distance to core + pickup",core_distance)
        
        if shortest_distance == None or core_distance <= shortest_distance:
            remaining_distance = MD_core_and_exit(state, core_pos, end_pos, new_core_positions, MD)
            # print("remaning distance =", remaining_distance)
            core_distance += remaining_distance
        if shortest_distance == None or core_distance < shortest_distance:
            shortest_distance = core_distance

    return shortest_distance - 3

