def MD_agent_to_exit(state: State):

    end_id = next(iter(state.exit.keys()))
    end_pos = state.position.get(end_id)

    return MD_agent_to_goal(state, end_pos)



def MD_agent_to_goal(state: State, goal_pos:Position):
      
    agent_id = next(iter(state.agent.keys()))
    agent_pos = state.position.get(agent_id)

    MD = get_MD(state)
    # print(MD)

    return MD(agent_pos, goal_pos) - 3


def MD_shortest(start_pos_set, end_pos_set):
    shortest_distance = None
    for start_pos in start_pos_set:
        for end_pos in end_pos_set:
            distance = basic_MD(start_pos, end_pos)
            if shortest_distance == None or distance <= shortest_distance:
                shortest_distance = distance
    return shortest_distance

def MD_nearest_pos(start_pos_set, end_pos_set):
    #Returns pos in end_pos_set closest to start_pos
    shortest_distance = None
    closest_start_pos = None
    closest_end_pos = None

    for start_pos in start_pos_set:
        for end_pos in end_pos_set:
            distance = basic_MD(start_pos, end_pos)
            if shortest_distance == None or distance < shortest_distance:
                shortest_distance = distance
                closest_start_pos = start_pos
                closest_end_pos = end_pos
    
    return closest_start_pos, closest_end_pos, shortest_distance





