def get_MD_with_boots(state: State, MD):
    if len(state.speed) == 0:
        return MD
    
    def MD_with_boots(start_pos, end_pos):
        MD_shortest = MD(start_pos, end_pos)

        for boot_id in state.speed.keys():
            boot_pos = state.position.get(boot_id)
            if boot_pos == None:
                continue
            limit = state.time_limit.get(boot_id).amount
            MD_with_boot = MD(start_pos, boot_pos) + max(MD(boot_pos, end_pos) - 3*limit, MD(boot_pos, end_pos)/2)
            if MD_with_boot < MD_shortest:
                MD_shortest = MD_with_boot

        
        return MD_shortest

    return MD_with_boots



def get_MD_with_coin(state, MD):
    if len(state.rewardable) == 0:
        return MD
    
    coin_clusters = find_coin_clusters(state)
    
    if len(coin_clusters) == 0:
        return MD


    def MD_with_coin(start_pos, end_pos):
        # return MD_with_coin_cluster({start_pos},{end_pos}, coin_clusters)
        _, shortest_distance = pos_and_MD_with_coin_cluster({start_pos}, end_pos, coin_clusters, MD)
        return shortest_distance
    
    return MD_with_coin
    
def pos_and_MD_with_coin_cluster(start_pos_set, end_pos, coin_clusters, MD):

    # print(coin_clusters)

    if len(coin_clusters) == 0:
        
        closest_start_pos, _, shortest_distance = MD_nearest_pos(start_pos_set,{end_pos})

        return closest_start_pos, shortest_distance
    else:
        closest_start_pos, _, shortest_distance = MD_nearest_pos(start_pos_set,{end_pos})
        # print("without coins")
        # print(shortest_distance)

        for cluster in coin_clusters:
            new_coin_clusters = coin_clusters.copy()
            new_coin_clusters.remove(cluster)

            temp_start_pos, cluster_start_pos, distance = MD_nearest_pos(start_pos_set, cluster)

            # print("distance to cluster")
            # print(distance)
            
            if distance <= shortest_distance:
                #This condition is to cut an additional function call if distance to cluster is already greater than distance to end
                cluster_end_pos, remaining_distance = pos_and_MD_with_coin_cluster(cluster, end_pos, new_coin_clusters, MD)

                # passed_coins = basic_MD(cluster_start_pos, cluster_end_pos)/3 + 1

                distance_through_cluster = MD(cluster_start_pos, cluster_end_pos)/3 -2


                # print("distance_through_cluster")
                # print(distance_through_cluster)

                # print("remaining_distance")
                # print(remaining_distance)

                distance = distance + remaining_distance + distance_through_cluster
            
            # print("final distance")
            # print(distance)

            if distance < shortest_distance:
                shortest_distance = distance
                closest_start_pos = temp_start_pos
        return closest_start_pos, shortest_distance




