def find_coins(state):
    out = []
    coin_ids = state.rewardable.keys()
    for coin_id in coin_ids:
        if state.rewardable[coin_id].amount == 0:
            # print("fake reward")
            continue
        coin_pos = state.position.get(coin_id)
        # print(coin_pos)
        if coin_pos != None:
          out.append(coin_pos)
    return out

