def find_coin_clusters(state):
    coin_clusters = []
    
    for coin_pos in find_coins(state):
        # if coin_pos == None:
        #     print("coin_pos == None:")
        cluster_found = None
        for adj_pos in [Position(coin_pos.x+1,coin_pos.y), Position(coin_pos.x-1,coin_pos.y), Position(coin_pos.x,coin_pos.y+1), Position(coin_pos.x,coin_pos.y-1), coin_pos]:
            for cluster in coin_clusters:
                if adj_pos in cluster:
                    if cluster_found == None:
                        cluster.add(coin_pos)
                        # print("added", coin_pos, "to cluster", cluster )
                        cluster_found = cluster
                    else:
                        if coin_pos not in cluster:
                            cluster_found.update(cluster)
                            # print("updated", cluster_found, "with", cluster)
                            coin_clusters.remove(cluster)
                            # print("removed", cluster)
                    break
                        
        if cluster_found == None:
            coin_clusters.append({coin_pos})
            # print("added new cluster",{coin_pos} )
        
    
    return coin_clusters

def split_3_channel(image_matrix):
    size = image_matrix.shape[0]
    split_channel = np.zeros((3,size,size))

    for i in range(3):
        split_channel[i,:,:] = image_matrix[:,:,i]
    
    return split_channel

def join_3_channel(split_channel):
    size = split_channel.shape[1]
    image_matrix = np.zeros((size,size,4))

    for i in range(3):
        image_matrix[:,:,i] = split_channel[i,:,:]
    image_matrix[:,:,3] = 255
    
    return image_matrix

