def split_image_into_cells(image:Image, height:int, width: int):
    

    resized_image = image.resize((CELL_SIZE * width, CELL_SIZE * height))
    resized_image_matrix = np.asarray(resized_image)


    # image_matrix = np.asarray(image)
    # resized_image_matrix = np.resize(image_matrix,(CELL_SIZE * width, CELL_SIZE * height, 4) )

    cell_image_3_channel = np.zeros((height, width, 3,CELL_SIZE,CELL_SIZE))
    cell_image = np.zeros((height, width, CELL_SIZE, CELL_SIZE, 4))

    for h in range(height):
        for w in range(width):
            cell_image_3_channel[h,w] = split_3_channel(resized_image_matrix[h*CELL_SIZE:(h+1)*CELL_SIZE, w*CELL_SIZE:(w+1)*CELL_SIZE])
            cell_image[h,w] = resized_image_matrix[h*CELL_SIZE:(h+1)*CELL_SIZE, w*CELL_SIZE:(w+1)*CELL_SIZE]
    
    # print(cell_image.shape)
    # print(cell_image[h,w].shape)
    return cell_image, cell_image_3_channel

