def get_background_identifier():
    def get_surrounding_pixels(image):
        #takes in 32 by 32 by 4 image matrix
        #returns vector of 124 surrounding pixeks

        if type(image) == Image:
            image_matrix = np.asarray(image)
        else:
            image_matrix = image

        size = image_matrix.shape[0]

        out = np.zeros((CELL_SIZE*4-4,4))

        out[0:CELL_SIZE,:] = image_matrix[0,0:CELL_SIZE,:] #top side
        out[CELL_SIZE:CELL_SIZE*2,:] = image_matrix[CELL_SIZE-1,0:CELL_SIZE,:] #bottom side
        out[CELL_SIZE*2:CELL_SIZE*3-2,:] = image_matrix[1:CELL_SIZE-1,0,:] #left side
        out[CELL_SIZE*3-2:CELL_SIZE*4-4,:] = image_matrix[1:CELL_SIZE-1,CELL_SIZE-1,:] #right side

        return out.flatten()
    
    
    def get_background_identifier_model():
        """
        Reconstruct and return a scikit-learn model from an embedded, base64-encoded compressed blob.

        Security note:
        This uses pickle-compatible loading. Only use if you trust the source.
        """
        import base64
        import pickle as _p
        import zlib as _z; _decomp = _z.decompress
        _blob_b64 = ""
        _raw = _decomp(base64.b64decode(_blob_b64))
        model = _p.loads(_raw)
        return model
    
    model = get_background_identifier_model()

    def background_identifier(cell_matrix):
        surrounding_pixels = get_surrounding_pixels(cell_matrix)
        prediction = model.predict([surrounding_pixels])
        return prediction[0]

    
    return background_identifier


def get_agent_identifier():
    from torch.nn import Softmax
    import torch
    
    def get_identify_agent_model(device: str = "cpu", dtype: str | None = None):
        """
        Return a TorchScript model loaded from an embedded, base64-encoded compressed blob.
        Self-contained: no need for the original Python class.

        Args:
            device: Where to map the model (e.g., "cpu", "cuda", "cuda:0").
            dtype: Optional dtype to convert parameters/buffers to (e.g., "float32", "float16").
        """
        import base64, io, torch
        import zlib as _z; _decomp = _z.decompress
        _blob_b64 = ""
        _raw = _decomp(base64.b64decode(_blob_b64))
        buf = io.BytesIO(_raw)
        m = torch.jit.load(buf, map_location=device)
        if dtype is not None:
            dt = getattr(torch, dtype) if isinstance(dtype, str) else dtype
            for p in m.parameters():
                p.data = p.data.to(dt)
            for b in m.buffers():
                b.data = b.data.to(dt)
        m.eval()
        return m
    
    identify_agent_model = get_identify_agent_model()


    def find_agent(cell_image_3_channel, height:int, width: int ):
        max_prob = 0
        h_out, w_out = None, None
        sm = Softmax(dim=1)
        for h in range(height):
            for w in range(width):
                y_pred = sm.forward(identify_agent_model(torch.tensor(cell_image_3_channel[h][w][np.newaxis, ...], dtype=torch.float32)))[0][1].item()
                y_pred = round(y_pred,3)
                if y_pred > max_prob:
                    max_prob = y_pred
                    h_out, w_out = h,w
        
        return (w_out, h_out)

    
    return find_agent



