class Agent:
    """Grid Universe agent template.

    This class is the single public interface that Coursemology will import and
    interact with when evaluating your submission. You should extend the
    internals (add helper classes / functions in other files if you wish) but
    MUST preserve:

    1. The class name: Agent
    2. The public method: step(self, state: Level | Observation) -> Action

    Highlevel lifecycle per environment tick:
        state  --->  step(...)  --->  Action

    The "state" object type depends on the task:
    - Task 1 & 2: a fully structured Level instance.
    - Task 3 & 4: a Observation dictionary whose primary observation is an RGBA image
      plus limited structured metadata in the 'info' subdict. In this case you
      typically perform perception to build (or approximate) an internal
      structured representation before planning.

    Performance constraints:
    - Keep perstep latency small (single CPU, ~1GB RAM). Avoid O(W*H) scans of
      the full grid every step.
    - Determinism helps reproducibility; seed your own RNG if you add any
      stochastic components.

    You may add __init__ parameters (with defaults) if needed for your own
    development, but the grader will instantiate Agent() with no arguments.
    """

    def __init__(self):
        """Initialize your agent.

        Put all onetime setup here (e.g., loading a decoded cipher mapping,
        hardcoded ML model weights, precomputing heuristic tables). Keep it fast
        and memorylight to respect platform limits.
        """
        # Placeholder for any future initialization logic
        self.memory = {}
        self.objective_decoder = get_objective_decoder()
        self.background_identifier = get_background_identifier()
        self.find_agent =get_agent_identifier()
        self.find_exit =get_exit_identifier()
        self.get_main_index = get_main_identifier()
        self.get_movement_index = get_movement_identifier()
        self.factory_array = [None, 
                                lambda moving_axis = None, moving_direction=None: create_monster(damage=1, moving_axis=moving_axis, moving_direction=moving_direction),
                                create_unlocked_door,
                                lambda: create_hazard(appearance=AppearanceName.SPIKE, damage=2),
                                create_portal,
                                lambda: create_coin(reward=5),
                                lambda: create_key(key_id="key"),
                                create_core,
                                lambda: create_speed_effect(multiplier=2, time=5), 
                                lambda: create_immunity_effect(usage=5), 
                                lambda: create_phasing_effect(time=5), 
                                lambda: create_door(key_id="key"), 
                                lambda: create_box(pushable=True), 
                                lambda moving_axis = None, moving_direction=None: create_box(pushable=False, moving_axis=moving_axis, moving_direction=moving_direction), 
                                 ]
        self.movement_array = [(None,None), 
                               (MovingAxis.HORIZONTAL,-1), 
                               (MovingAxis.HORIZONTAL,1), 
                               (MovingAxis.VERTICAL,-1), 
                               (MovingAxis.VERTICAL,1) ]
        self.next_actions = []

    def step(self, state: Level | Observation) -> Action:
        """Return the next action given the current environment state.

        Parameters
        ----------
        state : Level | Observation
            - If a Level instance (Tasks 1 & 2): you have direct, structured
              access to grid, entities, objective message, score, etc.
            - If a Observation dict (Task 3 and Capstone): contains 'image' (HW4 RGBA uint8)
              plus 'info' subdictionary (agent stats, partial config, message).
              You likely need to parse the image into an internal representation.

        Returns
        -------
        Action
            A valid action from the Action enum. Must always return a member;
            never return None. If your planner cannot produce an action in time,
            prefer a safe fallback (often Action.WAIT) while you recover.
        """     

        if len(self.next_actions) != 0:
            action = self.next_actions.pop(0)
            # print("recorded action:", action)
            return action

        if isinstance(state, Level):
            if state.message != None:
                # print("state.message",state.message)
                state.objective_fn = self.objective_decoder(state.message)
                # print("decoded_message = ",state.objective_fn)

            from_image = False
            state_repr = to_state(state)
        else:
            from_image = True
            

            # print("its an image")
            height = state["info"]["config"]["height"]
            width = state["info"]["config"]["width"]
            message = state["info"]["message"]
            seed = state["info"]["config"]["seed"]
            image = Image.fromarray(state["image"])

            if len(message) == 100:
                objective_fn = self.objective_decoder(message)
            else:
                objective_fn_name = state["info"]["config"]["objective_fn"]
                if objective_fn_name.__eq__("default_objective_fn"):
                    objective_fn = default_objective_fn
                else:
                    objective_fn = exit_objective_fn

            level_repr = Level(
                width=width,
                height=height,
                move_fn=default_move_fn,           # choose movement semantics
                objective_fn=objective_fn,
                seed=seed,
            )

            cell_images, cell_image_3_channel = split_image_into_cells(image, height, width)
            floor_pos = []
            for h in range(height):
                for w in range(width):
                    level_repr.add((w,h), create_floor())

                    background_index = self.background_identifier(cell_images[h][w])
                    if background_index == 1:
                        level_repr.add((w,h), create_wall())
                    elif background_index == 2:
                        level_repr.add((w,h), create_hazard(appearance=AppearanceName.LAVA, damage=2))
                    else:
                        floor_pos.append((w,h))

            
            agent_pos = self.find_agent(cell_image_3_channel, height, width)
            level_repr.add(agent_pos, create_agent(health=state["info"]["agent"]["health"]["health"] ))
            exit_pos = self.find_exit(cell_image_3_channel, height, width)
            level_repr.add(exit_pos, create_exit())

            

            # print(floor_pos)

            if agent_pos in floor_pos:
                floor_pos.remove(agent_pos)
            if exit_pos in floor_pos:
                floor_pos.remove(exit_pos)

            prev_portal = None
            for w, h in floor_pos:
                
                factory_index = self.get_main_index(cell_image_3_channel[h][w])
                if factory_index == 0:
                    pass
                elif factory_index == 4:
                    if prev_portal == None:
                        prev_portal = create_portal()
                        level_repr.add((w,h), prev_portal)
                    else:
                        level_repr.add((w,h), create_portal(pair=prev_portal))
                elif factory_index == 1 or factory_index == 13:
                    factory = self.factory_array[factory_index]
                    movement_index = self.get_movement_index(cell_image_3_channel[h][w])
                    # print("movement_index",movement_index)
                    movingAxis, movingDirection = self.movement_array[movement_index]
                    object = factory(moving_axis=movingAxis,moving_direction = movingDirection )

                    level_repr.add((w,h), object)
                else:
                    factory = self.factory_array[factory_index]
                    level_repr.add((w,h), factory())

            
            state_repr = to_state(level_repr)
            

        if state_repr in self.memory:
            # print("from memory")
            return self.memory[state_repr]

        # print("time limie", state_repr.time_limit)
        solution = get_solution(state_repr)

        prev_state = state_repr


        for node in solution:
            agent_pos = node.state.position.get(next(iter(node.state.agent.keys())))
            self.memory[to_state(from_state(prev_state))] = node.act
            if from_image:
                self.next_actions.append(node.act)
            prev_state = node.state
        if len(solution) == 0:
            return Action.WAIT
        
        if from_image:
            # print("recorded", len(self.next_actions), "actions")
            action = self.next_actions.pop(0)
            # print("action", action)
            return action

        return self.memory[state_repr]